var TEMPLATE_TYPE = 'handlebars';
var TemplateController = (function(){
	var _templateRegistry = {};
	var _getTemplate = function( id ){
		if( !_templateRegistry[id] ){
			var html = $('#' + id).html(), template;
			if(html){ 
				(function(){ template = Handlebars.compile(html) })();
			}else{
				template = (function(){ return ''; })();
			}
			return template;
		}
	};
	var _getRawTemplate = function( id ){
		if( !_templateRegistry[id] ){
			var html = $('#' + id).html();
			return html?html:'';
		}
	};
	var _addHelper = function( name, func ){
		Handlebars.registerHelper( name , func );
	};
	var _init = function(){
		_addHelper( 'jsonToText', function( object ){ 
			console.log( object );
			return new Handlebars.SafeString( JSON.stringify( object) );
		} );
		_addHelper( 'forEach', function( object, rootObject ){
			var output = '';
			for(var key in object){
				output += rootObject.fn( { 'key': key, 'value': object[key], 'super': rootObject.data } );
			}
			return new Handlebars.SafeString( output );
		} );
	};
	return { init: _init, getTemplate: _getTemplate, getRawTemplate: _getRawTemplate, addHelper: _addHelper };
})();

var PreloaderController = (function(){

	var _PRELOADER_IMG_SRC = 'url("data:image/gif;base64,")';

	var preloaderEl, $preloaderEl;
	var _init = function(){

		var _preloaderStyle = "width: 100%; height: 100%; position: fixed; top: 0; left: 0; display: none; background: rgba(0, 0, 0, 0.7)";
		//var _preloaderImgStyle = "left: 50%; top: 50%; margin: -20px 0 0 -20px; position: absolute;";
		var _preloaderImgStyle = "left: 0; top: 50%; width: 100%; margin-top: -64px; height: 128px; position: absolute; background: white " + _PRELOADER_IMG_SRC + ' no-repeat center center';

		var preloaderImg = document.createElement('div');
		preloaderImg.setAttribute('style', _preloaderImgStyle );

		var preloaderContainer = document.createElement('div');
		preloaderContainer.appendChild( preloaderImg );
		preloaderContainer.setAttribute( 'style', _preloaderStyle );
		
		preloaderEl = preloaderContainer;
		document.body.appendChild( preloaderEl );

		$preloaderEl = $(preloaderEl);

	};
	var _show = function(){ $preloaderEl.fadeIn(); };
	var _hide = function(){ $preloaderEl.fadeOut(); };
	return { show: _show, hide: _hide, init: _init };
})();

var JSONPresentationController = (function(){
	var wind;
	var showJSON = function( json ){
		if( wind ){ wind.close(); }
		var w = (window.innerWidth/2) - 200, h = (window.innerHeight/2) - 200;
		wind = window.open( null, "_blank", "toolbar=no, scrollbars=yes, resizable=no, top="+h+", left="+w+", width=400, height=400");
		wind.document.write('<textarea readonly="readonly" style="width:100%; height: 100%; outline: none; border: none">' + json + '</textarea>' );
	};
	return { showJSON: showJSON };
})();

var DeveloperController = (function(){
	var _developerAction = function( ){	
		var isDev = isDeveloper();
		window.IS_DEVELOPER = isDev;
		if( isDev ){
			console.log('In Development Mode!');
			$('body').removeClass('production');
		}else{
			$('body').addClass('production');
		}
	};
	var isDeveloper = function( bool ){
		if( localStorage['isDeveloper'] === 'YES' ){ 
			return true;
		}else{ return false; }
	};
	var setDeveloper = function( bool ){
		localStorage['isDeveloper'] = bool?'YES':'NO';
		_developerAction();
		location.hash = "";
	};

	var _checkHash = function(){
		if( location.hash === '#DEV'){ setDeveloper(true); }
		if( location.hash === '#NODEV'){ setDeveloper(false); }
	};
	var init = function(){
		window.onhashchange = _checkHash;
		_developerAction();
	}
	return { init: init, setDeveloper: setDeveloper };
})();

$(DeveloperController.init);
